    @tf.function(experimental_relax_shapes=True)
    def train_step(self, x, y, input_shape):
        """ Execute one training step (forward pass + backward pass)
        Args:
            source_seq: source sequences
            target_seq_in: input target sequences (<start> + ...)
            target_seq_out: output target sequences (... + <end>)

        Returns:
            The loss value of the current pass
        """
        with tf.GradientTape() as tape:
            z_log_var, z_mean, z = self.encoder(x, training=True)
            y_ = self.decoder(z, training=True)
            loss, kl_loss = self.loss_func(y, y_, z_log_var, z_mean, input_shape)
        self.metrics.update_state(y, y_)

        variables_encoder = self.encoder.trainable_variables
        variables_decoder = self.decoder.trainable_variables
        variables = variables_encoder + variables_decoder

        gradients = tape.gradient(loss, variables)
        self.optimizer.apply_gradients(zip(gradients, variables))

        return loss, kl_loss, gradients, variables,

    @tf.function(experimental_relax_shapes=True)
    def _evaluate(self, x, y, input_shape):
        """ Execute one training step (forward pass + backward pass)
        Args:
            source_seq: source sequences
            target_seq_in: input target sequences (<start> + ...)
            target_seq_out: output target sequences (... + <end>)

        Returns:
            The loss value of the current pass
        """
        z_log_var, z_mean, z = self.encoder(x, training=False)
        y_ = self.decoder(z, training=False)
        loss, kl_loss = self.loss_func(y, y_, z_log_var, z_mean, input_shape)
        self.metrics.update_state(y, y_)

        return loss, kl_loss

    def fit_batches(self, train, val, batch_size=32, epochs=10):
        x_train, y_train = train
        x_val, y_val = val

        n_train_samples = x_train.shape[0]
        n_test_samples = x_val.shape[0]

        print("train samples: ", n_train_samples, " val_samples: ", n_test_samples)
        for epoch in range(epochs):
            # Shuffle data
            train_index = np.random.choice(n_train_samples, n_train_samples, replace=False)
            x_train = x_train[train_index]
            y_train = y_train[train_index]

            mean_loss = []
            kl_loss_mean = []
            for batch in range(n_train_samples // batch_size + 1):
                i = batch * batch_size
                j = (batch + 1) * batch_size

                if j >= n_train_samples:
                    j = n_train_samples

                x_train_split = np.array([np.load(x) for x in x_train[i:j]])
                y_train_split = np.array([np.load(y) for y in y_train[i:j]])
                y_train_split = np.expand_dims(y_train_split[:, :, :, 4], axis=-1)
                train_split_len = len(x_train_split)

                loss, kl_loss, _, _ = self.train_step(x_train_split, y_train_split, x_train_split[0].shape)
                mean_loss.append(loss.numpy())
                kl_loss_mean.append(kl_loss.numpy())

            train_acc = self.metrics.result().numpy()

            mean_val_loss, val_acc = self.evaluate(batch_size, x_val, y_val)

            gc.collect()
            mean_loss = np.mean(mean_loss)
            kl_loss = np.mean(kl_loss_mean)
            mean_val_loss = np.mean(mean_val_loss)

            print('epoch', epoch, "\tloss: ", mean_loss, "\tkl_loss: ", kl_loss, "\tacc: ", train_acc, "\tval_loss: ", mean_val_loss, "\tval_acc: ", val_acc)

    def evaluate(self, batch_size,  x_val, y_val):
        val_loss = 0
        mean_val_loss = []
        n_test_samples = x_val.shape[0]

        for batch_val in range(n_test_samples // batch_size + 1):

            i = batch_val * batch_size
            j = (batch_val + 1) * batch_size

            if j >= n_test_samples:
                j = n_test_samples

            x_val_batch = np.array([np.load(x) for x in x_val[i:j]])
            y_val_batch = np.array([np.load(y) for y in y_val[i:j]])
            y_val_batch = np.expand_dims(y_val_batch[:, :, :, 4], axis=-1)

            val_loss, val_kl_loss = self._evaluate(x_val_batch, y_val_batch, x_val_batch[0].shape)

            mean_val_loss.append(val_loss.numpy())

        return np.mean(mean_val_loss), self.metrics.result().numpy()


